import React from 'react';
import { Row, Col, Card, Form, FloatingLabel, InputGroup, Button } from 'react-bootstrap';
import Select from 'react-select';

// components
import PageTitle from '../../components/PageTitle';
import Table from '../../components/Table';

//dummy data
import { records as data, expandableRecords } from '../tables/data';

const columns = [
    {
        Header: 'ID',
        accessor: 'id',
        sort: true,
    },
    {
        Header: 'Name',
        accessor: 'name',
        sort: true,
    },
    {
        Header: 'Phone Number',
        accessor: 'phone',
        sort: false,
    },
    {
        Header: 'Age',
        accessor: 'age',
        sort: true,
    },
    {
        Header: 'Company',
        accessor: 'company',
        sort: false,
    },
];

const sizePerPageList = [
    {
        text: '5',
        value: 5,
    },
    {
        text: '10',
        value: 10,
    },
    {
        text: '25',
        value: 25,
    },
    {
        text: 'All',
        value: data.length,
    },
];

const ContactInputElements = () => {
    return (
        <Card>
            <Card.Body>
                <h4 className="header-title mt-0">Añadir Contacto</h4>
                <p className="sub-header">
                    Añade un nuevo contacto
                </p>
                <Form className="form-horizontal">
                    <Row>
                        <Col lg={11}>
                            <Form.Group as={Row} className="mb-3">
                                <Form.Label column lg={2} htmlFor="simpleinput">
                                    Empresa
                                </Form.Label>
                                <Col lg={10}>
                                    <Form.Control type="text" id="simpleinput" defaultValue="Nombre de Empresa..." />
                                </Col>
                            </Form.Group> 
                            <Form.Group as={Row} className="mb-3">
                                <Form.Label column lg={2}>
                                    CIF/NIF
                                </Form.Label>
                                <Col lg={10}>
                                    <Form.Control type="text" name="simpleinput" placeholder="Añadir CIF/NIF"/>
                                </Col>
                            </Form.Group>
                            <Form.Group as={Row} className="mb-3">
                                <Form.Label column lg={2} htmlFor="example-email">
                                    Emails
                                </Form.Label>
                                <Col lg={10}>
                                     <Form.Control type="email" placeholder="name@example.com" />
                                </Col>
                            </Form.Group>
                            <Form.Group as={Row} className="mb-3">
                                <Form.Label column lg={2}>
                                    Tel
                                </Form.Label>
                                <Col lg={10}>
                                    <Form.Control type="tel" name="tel" placeholder="Añadir Teléfono"/>
                                </Col>
                            </Form.Group>
                            <Form.Group as={Row} className="mb-3">
                                <Form.Label column lg={2}>
                                    Web
                                </Form.Label>
                                <Col lg={10}>
                                    <Form.Control type="url" name="url" placeholder="Añadir Web"/>
                                </Col>
                            </Form.Group>
                            <Form.Group as={Row} className="mb-3">
                                <Form.Label column lg={2} htmlFor="example-textarea">
                                    Notas
                                </Form.Label>
                                <Col lg={10}>
                                    <Form.Control as="textarea" rows={5} id="notas" placeholder="Añadir información adiccional" />
                                </Col>
                            </Form.Group>
                            <div className="clearfix text-end mt-3">
                                    <Button variant="success">
                                    Guardar<i className="uil uil-arrow-right me-1"></i> 
                                    </Button>
                             </div>
                        </Col>
                    </Row>
                </Form>
            </Card.Body>
        </Card>
    );
};

const FloatingLabels = () => {
    return (
        <>
            <h4 className="mb-3 header-title mt-0">Floating label</h4>

            <Row>
                <Col>
                    <FloatingLabel controlId="floatingInput" label="Email address" className="mb-3">
                        <Form.Control type="email" placeholder="name@example.com" />
                    </FloatingLabel>
                    <FloatingLabel controlId="floatingPassword" label="Password" className="mb-3">
                        <Form.Control type="password" placeholder="Password" />
                    </FloatingLabel>
                </Col>
            </Row>
        </>
    );
};


const ContactForms = () => {
    return (
        <React.Fragment>
            <PageTitle
                breadCrumbItems={[
                    { label: 'Formularios', path: '/forms/contact' },
                    { label: 'Basic Contact', path: '/forms/contact', active: true },
                ]}
                title={'Basic Contact'}
            />

            <Row>
                <Col xs={12}>
                    <ContactInputElements />
                </Col>
            </Row>
        </React.Fragment>
    );
};
export default ContactForms;
